import HomePage from './pages/home';
import SearchPage from './pages/search';
import PetDetailsPage from './pages/detail';
import PetDetailsNotFound from './pages/petDetailsNotFound';
import Root from './components/root';


// Add react-router-dom imports
import {RouterProvider, Route, createBrowserRouter,createRoutesFromElements, Routes} from 'react-router-dom';
// create router with JSX Route elements
const appRouter = createBrowserRouter(createRoutesFromElements(<Route path="/" element={<Root />}/>));
const home = createBrowserRouter(createRoutesFromElements(<Route path=":type" element={<HomePage />}/>));
const petDetail = createBrowserRouter(createRoutesFromElements(<Route path=":type/:id" element={<PetDetailsPage />}/>));
function App() {
  return (
    // replace below with a Router Provider

    <RouterProvider router={appRouter}>
      <RouterProvider router={home}/>
      <RouterProvider router={petDetail}/>
    </RouterProvider>
  );
}

export default App;
